import React from "react";
import { Component } from "react";
import Button from "./Button";
// import Operand from './Operand';
// import Operator from './Operator';
import "./dialpad.css";
class Dialpad extends Component {
  handleClick = ButtonName => {
    this.props.onClick(ButtonName);
  };
  onKeyDown = event => {
    let str = event.target.className;
    event.target.className = str + " active";
  };
  onKeyUp = event => {
    event.target.className = event.target.className.substr(
      0,
      event.target.className.length - 7
    );
  };
  render() {
    return (
      <>
        <div className="dialpad" tabIndex={0}>
          <Button
            name="AC"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="CE"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="%"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="/"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />

          <Button
            name="1"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="2"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="3"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="*"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />

          <Button
            name="4"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="5"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="6"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="+"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />

          <Button
            name="7"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="8"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="9"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="-"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />

          <Button
            name="0"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="."
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="="
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
          <Button
            name="Usqrt"
            onClick={this.handleClick}
            disabled={this.props.disabled}
            onKeyDown={this.props.onKeyDown}
            onKeyUp={this.props.onKeyUp}
          />
        </div>
      </>
    );
  }
}

export default Dialpad;
